import React from 'react';
import data from './data.json'
import styles from './App.module.css';
import Header from './components/MenuHeader';
import Menu from './components/Menu.js';
import Ostoskori from './components/Ostoskori';


const sidefiles=[


  {
    topic:'Ostoskori',
    body:'TÄHÄN TULEE OSTOSKORI.'

  },


]

const mainfiles=[
  {
    topic:'Pizzat',
    kuva: 'Pizza.jpg',
  },
  {
    topic:'Burgerit',
    kuva: 'Hampurilainen.jpg',
  },
  {
    topic:'Juomat',
    kuva: 'Kahvi.jpg',
  },

]

function App() {

  return (

  <div>
    <Header />
    <div className={styles.row}>
      <div className={styles.maincontainer}>
         {
           mainfiles.map(element => <Menu topic ={element.topic} body={element.body} kuva={element.kuva} />)  
         }
         </div>
         </div>

      <div className={styles.sidecontainer}>
         {
           sidefiles.map(element => <Ostoskori topic ={element.topic}/>)   
         }
 
        </div>
      </div>


  )
}

export default App;
